import React from "react";
import '../App.css'
import Navbar from './Navbar';
import image from '../src-imgs/light-bulb-error'


function Error() {


    return (
        <section className="error">

        <Navbar />

        <div className="errorPage">
            <img src={image} alt="" />
            <h2>Unable to load Workshops...</h2>
        </div>


    </section>
    )
}

export default Error
